import React, { Component } from 'react'
import ListaChicotes from './ListaChicotes'

class ListaTiposComponentes extends Component{
    render(){
        return (
            <ul>
                <li>
                    <h2>Chicotes</h2>
                    <ListaChicotes/>
                </li>
                <li>Bases</li>
                <li>Fixture</li>
                <li>Gravadores</li>
            </ul>
        )
    }
}
export default ListaTiposComponentes
